import '../styles/clubs.css';
import React, { useEffect, useState } from 'react';

function Teams() {
  const [teams, setTeams] = useState([]);

  useEffect(() => {
    const fetchTeams = async () => {
      const url = 'http://api.football-data.org/v4/competitions/PL/teams';
      const options = {
        headers: {
          'X-Auth-Token': 'YOUR_API_KEY'
        }
      };

      try {
        const response = await fetch(url, options);
        if (!response.ok) {
          throw new Error('Network response was not ok ' + response.statusText);
        }
        const data = await response.json();
        setTeams(data.teams);
      } catch (error) {
        console.error('There has been a problem with your fetch operation:', error);
      }
    };

    fetchTeams();
  }, []);

  return (
    <div className="container">
      <h1>2023/24 Premier League Teams</h1>
      <div className="row">
        {teams.map((team) => (
          <div key={team.id} className="col-md-6 mb-3">
            <div className="card team-card">
              <div className="card-img-top text-center">
                <img
                  src={team.crestUrl}
                  className="img-fluid rounded-top team-img mx-auto"
                  alt={team.name}
                />
              </div>
              <div className="card-body">
                <h2>{team.name}</h2>
                <p><strong>Short Name:</strong> {team.shortName}</p>
                <p><strong>TLA:</strong> {team.tla}</p>
                <p><strong>Founded:</strong> {team.founded}</p>
                <p><strong>Venue:</strong> {team.venue}</p>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Teams;
